create table MsAnimalType (
	AnimalTypeID VARCHAR(6) PRIMARY KEY,
	AnimalTypeName VARCHAR(10)
);

create table MsAnimal (
	AnimalID VARCHAR(6) PRIMARY KEY,
	AnimalName VARCHAR(255),
	AnimalPrice DECIMAL(10,2),
	AnimalGender VARCHAR(50),
	AnimalTypeID VARCHAR(6),
	FOREIGN KEY (AnimalTypeID) REFERENCES MsAnimalType (AnimalTypeID)
);

create table TransactionHeader (
	TransactionID VARCHAR(7) PRIMARY KEY,
	CustomerID VARCHAR(6),
	StaffID VARCHAR(6),
	TransactionDate DATE
);

create table TransactionDetail (
	TransactionID VARCHAR(7),
	AnimalID VARCHAR(6),
	Quantity INT,
	PRIMARY KEY(TransactionID, AnimalID)
);
